import React from "react";

const Card = (props) => {
    return (
        <div className="card" >
            <img src={props.imgsrc} className="card-img-top" alt="image" />
            <div className="card-body">
                <h5 className="card-title">{props.name}</h5>
                <h3 className="card-title">{props.id}</h3>
                <a href="#" className="btn btn-primary">CAUGHT</a>
            </div>
        </div>
    )
}

export default Card;
